DYAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAU\ngmAHAACgEAQ7AAAAhSDYAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAH\nAACgEAQ7AAAAhSDYAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAHAACg\nEAQ7AAAAhSDYAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAHAACgEAQ7\nAAAAhSDYAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAHAACgEAQ7AAAA\nhSDYAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAHAACgEAQ7AAAAhSDY\nAQAAKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAHAACgEAQ7AAAAhSDYAQAA\nKATBDgAAQCEIdgAAAApBsAMAAFAIgh0AAIBCEOwAAAAUgmAHAACgEAQ7AAAAhSDYAf9vtw5k\nAAAAAAb5W9/jK4oAYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAm\nxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAm\nxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAm\nxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAm\nxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAm\nxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAm\nxA4AYELsAAAmxA4AYELsAAAmxA4AYELsAAAmAtvfpACwuTjLAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["## calculating the total for each activity\n","total_mins <- daily_activity %>%\n","  summarise(\n","    sum_vam = round(sum(very_active_minutes), 2),\n","    sum_fam = round(sum(fairly_active_minutes), 2),\n","    sum_lam = round(sum(lightly_active_minutes), 2),\n","    sum_sm = round(sum(sedentary_minutes), 2),\n","    total_sum = sum_vam + sum_fam + sum_lam + sum_sm)\n","\n","## finding the % for each activity and converting it to long data\n","total_mins_percentage <- total_mins %>% \n","  mutate(\n","    Very_Active_minutes = (sum_vam / total_sum) * 100,\n","    Fairly_Active_minutes = (sum_fam / total_sum) * 100, \n","    Lightly_Active_minutes = (sum_lam / total_sum) * 100,\n","    Sedentary_minutes = (sum_sm / total_sum) * 100) %>%\n","  select(\n","    Very_Active_minutes,\n","    Fairly_Active_minutes,\n","    Lightly_Active_minutes,\n","    Sedentary_minutes) %>% \n","  round(digits = 2) %>% \n","  pivot_longer(\n","    cols = c(Very_Active_minutes, Fairly_Active_minutes, Lightly_Active_minutes, Sedentary_minutes),\n","    names_to = \"activity\",\n","    values_to = \"percentage\")\n","\n","## making a pie chart from the data\n","pie(\n","  total_mins_percentage$percentage,\n","  labels = paste(total_mins_percentage$activity, total_mins_percentage$percentage, \"%\"),\n","  col = c(\"red\", \"yellow\", \"limegreen\", \"skyblue\"),\n","  main = \"Percentage of minutes for each activity\"\n",")\n","par(mar = c(5, 4, 4, 2) + 0.1)"]},{"cell_type":"markdown","id":"14ec4928","metadata":{"papermill":{"duration":0.015573,"end_time":"2023-10-23T17:28:31.045083","exception":false,"start_time":"2023-10-23T17:28:31.02951","status":"completed"},"tags":[]},"source":["* Sedentary minutes are defined as the amount of time spent doing very low-intensity or motion-light activities. Sitting, lying down, or performing other low-energy activities tend to be among these activities. From the Percentage of Minutes for each activity pie chart, **81.33%** of the time daily is spent just on sedentary minutes and activities.\n","\n","* Activities that demand some movement but don’t significantly raise heart rate or energy expenditure are considered Light activity minutes. Slow walking, casual biking, mild stretching, and household tasks are a few examples of light activities. The second highest percentage, although a stark difference compared to sedentary, is associated with it with **15.82%.**\n","\n","* A moderate amount of physical activity is represented by Fairly active minutes. A few examples of moderately energetic pursuits are gardening, leisurely cycling, and brisk walking. The lowest percentage of only **1.11%** is of fairly active minutes.\n","\n","* Very active minutes are defined as those spent performing vigorous physical activities with a markedly elevated heart rate, respiration rate, and energy expenditure. These activities, which can include running, jogging, intense cycling, swimming, and taking part in high-intensity interval training, are often associated with rigorous exercise. **1.74%** of the total percentage is spent in minutes by users on very active activities."]},{"cell_type":"markdown","id":"b2b020d0","metadata":{"papermill":{"duration":0.015194,"end_time":"2023-10-23T17:28:31.075616","exception":false,"start_time":"2023-10-23T17:28:31.060422","status":"completed"},"tags":[]},"source":["### Average Total Intensity Per Day\n","\n","Now we can try to find out at which day the users or people generally are most active. Hence, we can calculate the total intensity per day being used by the users in the form of a bar chart."]},{"cell_type":"code","execution_count":20,"id":"c72fb760","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:28:31.109194Z","iopub.status.busy":"2023-10-23T17:28:31.107578Z","iopub.status.idle":"2023-10-23T17:28:31.51382Z","shell.execute_reply":"2023-10-23T17:28:31.511036Z"},"papermill":{"duration":0.426331,"end_time":"2023-10-23T17:28:31.516853","exception":false,"start_time":"2023-10-23T17:28:31.090522","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2CU9f3A8e/lMkgIewi4QEFwoVgXLpytOHCBqxVwtHXVWifugT+trVL3qKNW\nraJFrbt148Ct1YoLwQmiDCGM7Nzvj2hkhksu4cjX1+svnueeHJ/78sC9ucs9SaRSqQAAQMuX\nk+0BAABoGsIOACASwg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACASwg5WqlTNgvWK8hOJ\nRE4y/435ldkeZ6V67Q8bJ9Iw5J0ZzTTAu5dukUgkdnnws/oPu7hX+0Qisder3zTTGE3uzTM2\nTSQSg8dPy/YgTWPpUyK3oHj1Xn33P/LUh9+dle3pYFWXm+0B4Kdl1v9GTSqtDCGkaipPu/+z\nZ4b3yfZEK0+rzmv17l1Wt5mqWTB5yteJRO666/Zc9LDuBckV3lWqZsGEl/+bW7DWVpuv2eRz\nNsIqNc8qNUyjrblu74LE978uLZk9/fNJD9x62b9uu/qQPz72j1N3zuposEoTdrBSPXfKv0II\nPfZYZ9pjU946729h+MXZnmjl6X/Wo5PO+nGz7LvHCjvumZPXZdKkSQ29q6rSj7fbbru2a50z\n9/MLm3LExsruPD2Hjb6t3+zV+3VYFYZpKg++8/6A1nl1mwu+/uD2K87//Z//eddpuxSu8+nN\nB