% \n","  summarize(average_total_intensity = mean(total_intensity))\n","\n","## making a bar chart to show the daily intensity done by users\n","ggplot(data = daily_intensity_day) + \n","  geom_col(mapping = aes(x = hourly_intensity_day, y = average_total_intensity, fill = \"peachpuff\")) +\n","  labs(title = \"Average Total Intensity per Day\", x = \"Week Day\", y = \"Intensity Level\") +\n","  theme(plot.title = element_text(hjust = 0.5)) +\n","  guides(fill = \"none\")"]},{"cell_type":"markdown","id":"81da0bed","metadata":{"papermill":{"duration":0.016026,"end_time":"2023-10-23T17:28:31.548932","exception":false,"start_time":"2023-10-23T17:28:31.532906","status":"completed"},"tags":[]},"source":["* From this bar chart it can be seen that users are most active on Saturday. On Saturday, people usually have more time to do some exercising and do some lightly active activities. On the contrary, people are the least active on Sundays as their intensity level is lowest on this day. This could be due to people opting for relaxation in their homes after doing some activities on Saturday."]},{"cell_type":"markdown","id":"06f51ccb","metadata":{"papermill":{"duration":0.015756,"end_time":"2023-10-23T17:28:31.580417","exception":false,"start_time":"2023-10-23T17:28:31.564661","status":"completed"},"tags":[]},"source":["### Average total intensity per Hour \n","\n","In order to get even more details about this we can calculate on an hourly basis too for the whole day in a bar chart."]},{"cell_type":"code","execution_count":21,"id":"cd64ac2e","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:28:31.615631Z","iopub.status.busy":"2023-10-23T17:28:31.614085Z","iopub.status.idle":"2023-10-23T17:28:31.949615Z","shell.execute_reply":"2023-10-23T17:28:31.946538Z"},"papermill":{"duration":0.356724,"end_time":"2023-10-23T17:28:31.952903","exception":false,"start_time":"2023-10-23T17:28:31.596179","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAA