Q2AEAAACYCDR2AAAAACYCjR0AAACAiUBj\nBwAAAGAi0NgBAAAAmAg0dgAAAAAm4n9os6o9rakIEQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["## making a new column in hourly_intensity showing the hour of the week\n","hourly_intensity$hourly_intensity_hour <- hour(hourly_intensity$date_time)\n","\n","## finding the average total intensity for each hour of the week\n","daily_intensity_hour <- hourly_intensity %>% \n","  group_by(hourly_intensity_hour) %>% \n","  summarize(average_total_intensity = mean(total_intensity))\n","\n","## making a bar chart to show the hourly intensity done by users\n","ggplot(data = daily_intensity_hour) + \n","  geom_col(mapping = aes(x = hourly_intensity_hour, y = average_total_intensity), fill = \"#FFD700\") +\n","  labs(title = \"Average Total Intensity per Hour\", x = \"Hour\", y = \"Intensity level\") +\n","  theme_classic() + \n","  theme(plot.title = element_text(hjust = 0.5)) +\n","  guides(fill = \"none\") +\n","  scale_x_continuous(breaks = seq(0, 23, by = 1))"]},{"cell_type":"markdown","id":"be9393c0","metadata":{"papermill":{"duration":0.024258,"end_time":"2023-10-23T17:28:31.998172","exception":false,"start_time":"2023-10-23T17:28:31.973914","status":"completed"},"tags":[]},"source":["* After understanding the average total intensity of users per hour, it can be inferred that people are most active from 5 pm to 7 pm (17.00 pm to 19.00 pm). This is a time most associated with after-work hours in many countries as mostly people become free from work till 5pm. 12 pm to 2 pm which is around lunch or after-lunch time is the second most activity intensive hours among people. It could be due to people having half an hour or an hour of free time during this time at work or in their homes to do some exercise or lightly active activities."]},{"cell_type":"markdown","id":"f24d14c1","metadata":{"papermill":{"duration":0.016274,"end_time":"2023-10-23T17:28:32.034936","exception":false,"sta