,"start_time":"2023-10-23T17:28:34.305973","status":"completed"},"tags":[]},"source":["### Percentage of Sleep for each Category\n","\n","The last analysis that we can do is finding out whether the amount of sleep people are getting is enough or not. According to [this article](https://academic.oup.com/sleep/article/38/6/843/2416939) sleeping less than 7 hours a night can be termed as low sleep which can be adverse for health over a period of time. On the other hand, 9 hours of sleep or more than that can be termed as either optimal or high (often sleep much higher than 9 hours can be problematic too). Hence, moderate sleep would be sleeping between 7 to 9 hours. \n","\n","Therefore, in order to find more useful information from this data we can try to see whether the amount of sleep they are getting is low, moderate, or high by making a pie chart again."]},{"cell_type":"code","execution_count":25,"id":"01890be7","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:28:34.369176Z","iopub.status.busy":"2023-10-23T17:28:34.367506Z","iopub.status.idle":"2023-10-23T17:28:34.748037Z","shell.execute_reply":"2023-10-23T17:28:34.746233Z"},"papermill":{"duration":0.404457,"end_time":"2023-10-23T17:28:34.750268","exception":false,"start_time":"2023-10-23T17:28:34.345811","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3gU5doG8GeyJb0nhNAJoXdp0hWwgWJHFBX7UT8EREUUEVFERAVBwQYIgoiA\nFGkCSSB0SAihJIQkpPdeNtt35vsjEELqJNnk3Z29f9e5rmNmZyf37M5mb6a8wwmCQAAAAABg\n/exYBwAAAAAA80CxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAA\niUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAI\nFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCx\nAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsA\nAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAA\nAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAAiUCxAwAAAJAIFDsAAAAA